import Navbar from './navbar';
import Footer from './footer'
import styles from '../../styles/layout.module.css';

const Layout = ({children}) => {
  return (
    <div className={styles.layout}>
      <Navbar />
      <div className='content'>
        { children }
      </div>
      <Footer />
    </div>
  )
}

export default Layout
